import React from 'react';

class Media extends React.PureComponent {

    constructor(props) {
        super(props)
        this.state = {id: props.location.aboutProps.id};
    }

    
    render() {

        return (
            <div>
                {this.props.location.aboutProps.trackId}
            </div>
        )
    }
    
}

export default Media;
